Poder Constituinte Originário: o Povo.

Características: 
1. Ele é Inicial: não existe nenhum outro antes ou acima dele;
2. Incondicionado: não está submetido a nenhuma regra de forma ou de conteúdo;
3. Permanente: continua existindo mesmo após concluir a sua obra;
4. Inalienável: sua titularidade não é possível de transferência (a nação nunca perde o direito de mudar sua vontade).


Ele é permanente, já que o poder constituinte originário não se esgota com a edição da nova Constituição, sobrevivendo a ela e fora dela como forma e expressão da liberdade humana, em verdadeira ideia de subsistência. É permanente, pois não desaparece com a realização de sua obra, ou seja, com a elaboração de uma nova Constituição. Como afirmado por Sieyès, o Poder Constituinte não esgota sua titularidade, que permanece latente, manifestando-se novamente mediante uma nova Assembleia Nacional Constituinte ou um ato revolucionário (povo na porta dos quartéis ordenando as FA).

Uma das formas de se exercer o poder constituinte: 

Este seria o melhor exemplo de exercício direto do poder constituinte, na medida em que, na revolução vitoriosa, necessariamente há a ruptura do regime anterior e “o nascimento de uma nova Constituição material, a que se segue, a curto, a médio ou em longo prazo, a adequada formalização”. Assim, o povo, titular do poder, impondo a sua vontade, determina uma nova e legítima ordem constitucional material, que, posteriormente, é formalizada.

Estas são as bases do direito Constitucional.  Todo ministro do STF sabe disso.

